import React from 'react';
import '../styles/main.css';

const Services = () => {
  return (
    <div className="page-container">
      <h1>Our Services</h1>
      <ul className="services-list">
        <li>Garden Design</li>
        <li>Plant Care</li>
        <li>Landscaping</li>
      </ul>
    </div>
  );
};

export default Services;
